import React from "react";
import GoogleLogin from "react-google-login";
// npm install react-google-login

//You have to use the link component to link between you pages
import { Link } from "react-router-dom";
import { Button } from "react-bootstrap";
//$ npm install --save react react-dom
//$ npm install --save react-bootstrap
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import HomePage from "./pages/home";

const responseGoogleSuccess = (response) => {
  console.log(response);
  console.log(response.profileObj);
};
const responseGoogleFailure = (response) => {
  console.log(response);
  console.log(response.profileObj);
  document.write("Not able to join to Meeting Ground\nLogin failed");
};

//Functional Component
const LoginPage = () => {
  function responseGoogle() {
    // return (
    // <Router>
    //   {/*All our Routes goes here!*/}
    //   <Switch>
    //     <Route exact path="/" component={LoginPage} />
    //     <Route exact path="/login" component={LoginPage} />
    //     <Route exact path="/home" component={HomePage} />
    //     <Route exact path="/404" component={NotFoundPage} />
    //     <Redirect to="/404" />
    //   </Switch>
    // </Router>
    // );
  }
  var next = "/home";
  return (
    <div>
      <img
        id="logo"
        src="./img/meetingGroundLogo.png"
        alt="Meeting Ground Logo"
      />
      <h3>Welcome to the React Router Tutorial</h3>
      <small>Main Page</small>
      <GoogleLogin
        clientId="272589905349-scqfilok0ucok40j6h6eo9pcsp7bhadd.apps.googleusercontent.com"
        buttonText="Login"
        onFailure={() => (
          <Router>
            <Switch>
              <Route exact path="/home" component={HomePage} />
            </Switch>
          </Router>
        )} // ()<link to="/login"></link>
        onSuccess={() => (
          <Router>
            <Switch>
              <Route exact path="/login" component={LoginPage} />
            </Switch>
          </Router>
        )} //() <link to="/home"></link>
        cookiePolicy={"single_host_origin"}
      />
      <Link to={next}>
        <Button renderAs="button">
          <span>Login</span>
        </Button>
      </Link>
    </div>
  );
};

export default LoginPage;
